import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const NewsletterContainer = styled.section`
  padding: 6rem 2rem;
  background: linear-gradient(135deg, ${props => props.theme.colors.secondary}, ${props => props.theme.colors.primary});
  position: relative;
  overflow: hidden;
`;

const NewsletterContent = styled.div`
  max-width: 800px;
  margin: 0 auto;
  text-align: center;
  position: relative;
  z-index: 2;
`;

const NewsletterTitle = styled(motion.h2)`
  font-family: ${props => props.theme.fonts.primary};
  font-size: clamp(2rem, 4vw, 3rem);
  color: ${props => props.theme.colors.white};
  margin-bottom: 1rem;
`;

const NewsletterSubtitle = styled(motion.p)`
  font-size: 1.2rem;
  color: ${props => props.theme.colors.white};
  opacity: 0.9;
  margin-bottom: 3rem;
  line-height: 1.6;
`;

const NewsletterForm = styled(motion.form)`
  display: flex;
  gap: 1rem;
  max-width: 500px;
  margin: 0 auto;
  
  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    flex-direction: column;
  }
`;

const EmailInput = styled.input`
  flex: 1;
  padding: 1rem 1.5rem;
  border: none;
  border-radius: 50px;
  font-size: 1rem;
  background: ${props => props.theme.colors.white};
  color: ${props => props.theme.colors.secondary};
  
  &::placeholder {
    color: rgba(51, 51, 51, 0.6);
  }
  
  &:focus {
    outline: none;
    box-shadow: 0 0 0 3px rgba(255, 255, 255, 0.3);
  }
`;

const SubmitButton = styled(motion.button)`
  padding: 1rem 2rem;
  background: ${props => props.theme.colors.gold};
  color: ${props => props.theme.colors.white};
  border: none;
  border-radius: 50px;
  font-weight: 600;
  cursor: pointer;
  white-space: nowrap;
  
  &:hover {
    background: ${props => props.theme.colors.primary};
  }
`;

const FloatingElements = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  pointer-events: none;
`;

const FloatingShape = styled(motion.div)`
  position: absolute;
  background: rgba(255, 255, 255, 0.1);
  border-radius: 50%;
`;

const Newsletter = () => {
  const [email, setEmail] = useState('');
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [ref, inView] = useInView({ threshold: 0.3, triggerOnce: true });

  const handleSubmit = (e) => {
    e.preventDefault();
    if (email) {
      setIsSubmitted(true);
      setTimeout(() => {
        setIsSubmitted(false);
        setEmail('');
      }, 3000);
    }
  };

  return (
    <NewsletterContainer ref={ref}>
      <FloatingElements>
        <FloatingShape
          style={{ width: '100px', height: '100px', top: '10%', left: '10%' }}
          animate={{
            y: [0, -20, 0],
            x: [0, 10, 0],
          }}
          transition={{
            duration: 6,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
        <FloatingShape
          style={{ width: '60px', height: '60px', top: '20%', right: '15%' }}
          animate={{
            y: [0, 15, 0],
            x: [0, -15, 0],
          }}
          transition={{
            duration: 4,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
        <FloatingShape
          style={{ width: '80px', height: '80px', bottom: '15%', left: '20%' }}
          animate={{
            y: [0, -10, 0],
            rotate: [0, 180, 360],
          }}
          transition={{
            duration: 8,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
      </FloatingElements>

      <NewsletterContent>
        <NewsletterTitle
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          Stay in the Loop
        </NewsletterTitle>
        
        <NewsletterSubtitle
          initial={{ opacity: 0, y: 20 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.2 }}
        >
          Subscribe to our newsletter for exclusive offers, new collection previews, 
          and jewelry care tips delivered straight to your inbox.
        </NewsletterSubtitle>

        {!isSubmitted ? (
          <NewsletterForm
            onSubmit={handleSubmit}
            initial={{ opacity: 0, y: 20 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <EmailInput
              type="email"
              placeholder="Enter your email address"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <SubmitButton
              type="submit"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Subscribe
            </SubmitButton>
          </NewsletterForm>
        ) : (
          <motion.div
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            style={{ 
              background: 'rgba(255, 255, 255, 0.2)', 
              padding: '2rem', 
              borderRadius: '20px',
              color: 'white',
              fontSize: '1.2rem'
            }}
          >
            Thank you for subscribing! Welcome to our exclusive community.
          </motion.div>
        )}
      </NewsletterContent>
    </NewsletterContainer>
  );
};

export default Newsletter;
